import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import Logo from './Logo';
import './Header.css';

const Header = () => {
  const location = useLocation();
  const isHomePage = location.pathname === '/';
  const isAboutPage = location.pathname === '/about';

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <Logo />
          <nav className="nav">
            <ul className="nav-list">
              <li><Link to="/about" className={isAboutPage ? 'active' : ''}>About</Link></li>
              {isHomePage && (
                <>
                  <li><a href="#solution">Solution</a></li>
                  <li><a href="#contract">Contract vehicles</a></li>
                  <li><a href="#employee">Employee portal</a></li>
                  <li><a href="#careers">Careers</a></li>
                  <li><a href="#news">News</a></li>
                </>
              )}
              {isAboutPage && (
                <>
                  <li><Link to="/">Solution</Link></li>
                  <li><Link to="/">Contract vehicles</Link></li>
                  <li><Link to="/">Employee portal</Link></li>
                  <li><Link to="/">Careers</Link></li>
                  <li><Link to="/">News</Link></li>
                </>
              )}
            </ul>
          </nav>
          <Link to={isHomePage ? "#contract" : "/"} className="btn btn-primary">
            {isHomePage ? "Contract" : "Home"}
          </Link>
        </div>
      </div>
    </header>
  );
};

export default Header;
